data.text:
This here, is warranted rage.

You decorate yourself in their sacrifice while allowing them to be endangered by dictators and give them "adequate" benefits when they are home.

@GOP, Go F*** Yourself. https://t.co/dgaTDt8g03

@MadameSignora The way she grabbed his face, just like before... As if his rage wasn’t already reaching the boiling point, that about pushed him to the edge.

“... Don’t touch me...”

The archon angrily spat in the harbinger’s face.
